import Layout from '../components/Layout';

const Register = () => {
  const registerForm = () => (
    <form>
      <input type='text' name='' id='' />
    </form>
  );

  return (
    <Layout>
      <div className='col-md-6 offset-md-3'>{registerForm()}</div>
    </Layout>
  );
};

export default Register;
